import React, { Component } from 'react'
import './ImgSlideBar'

export default class ImgSlideBar extends Component {
    render() {
        return (
            <div className="imgslide">
                <img src="https://static.bangkokpost.com/media/content/dcx/2020/02/07/3517079.jpg" alt="" width="50%" />
            </div>
        )
    }
}
